import ChatBot from "react-simple-chatbot";
import "./App.css";

function App() {
  const steps = [
    {
      id: "0",
      message: "Welcome To ClaimBot",
      trigger: "1",
    },
    {
      id: "1",
      message: "would yo like to see if you have a claim",
      trigger: "2",
    },
    {
      id: "2",
      options: [
        { value: 1, label: "Yes", trigger: "4" },
        { value: 2, label: "No", trigger: "3" },
      ],
    },
    { id: "4", message: "Then First Question", trigger: "5" },
    {
      id: "3",
      message: "really end ",
      end: true,
    },
  ];
  return (
    <div className="App">
      <div className="card-container">
        <ChatBot steps={steps} />
      </div>
    </div>
  );
}

export default App;
